import React, { useState, useEffect } from "react";
import "./Styles.css";

function Menu() {
  useEffect(() => {
    getData();
  }, []);

  const getData = async () => {
    const data = await fetch(
      "https://api.spoonacular.com/recipes/random?apiKey=66f3a4d769ef4fe49fa8a7233278bef6&number=10"
    );

    const items = data.json();
    console.log(items);
  };

  return (
    <div className="centered">
      <h2>our menu</h2>
    </div>
  );
}

export default Menu;
